$(document).ready(() => {
  $(window).scroll(function () {
    let windowScroll = $(window).scrollTop();
    if (windowScroll > 130) {
      $("#backTop").fadeIn(500).css("display","flex")
    }
    else {
      $("#backTop").fadeOut(500);
  
    }
  })
  $("#backTop").click(function () {
    $("html,body").animate({ scrollTop: 0 }, 300)
  })
  });
